INSERT INTO main_app_dog(name, img, bio, hypoallergenic, created_at) VALUES
    ('English Bulldog', 'https://media.cnn.com/api/v1/images/stellar/prod/220615105053-unhealthy-english-bulldogs.jpg', 'The Bulldog is a British breed of dog of mastiff type. It may also be known as the English Bulldog or British Bulldog. It is of medium size, a muscular, hefty dog with a wrinkled face and a distinctive pushed-in nose.', 'f', '2021-05-07 18:57:42.517205-07');
INSERT INTO main_app_dog(name, img, bio, hypoallergenic, created_at) VALUES
    ('French Bulldog', 'https://cdn.britannica.com/44/233844-050-A0F9F39C/French-bulldog.jpg', 'The French Bulldog, French: Bouledogue Fran√ßais, is a French breed of companion dog or toy dog. It appeared in Paris in the mid-nineteenth century, apparently the result of cross-breeding of Toy Bulldogs imported from England and local Parisian ratters.', 'f', '2021-05-07 18:57:42.517205-07');
INSERT INTO main_app_dog(name, img, bio, hypoallergenic, created_at) VALUES
    ('Boxer', 'https://media-be.chewy.com/wp-content/uploads/2021/04/16140537/Boxer_Feature-Image-1024x615.jpg', 'The Boxer is a medium to large, short-haired dog breed of mastiff-type, developed in Germany. The coat is smooth and tight-fitting; colors are fawn, brindled, or white, with or without white markings.', 'f', '2021-05-07 18:57:42.517205-07');
INSERT INTO main_app_dog(name, img, bio, hypoallergenic, created_at) VALUES
    ('Yorkshire Terrier', 'https://cdn.britannica.com/49/233849-050-2ECC4F03/Yorkshire-terrier-dog-running.jpg', 'The Yorkshire Terrier is one of the smallest dog breeds of the terrier type and indeed of any dog breed. The breed developed during the 19th century in Yorkshire, England. Ideally its maximum size is 7 pounds.', 't', '2021-05-07 18:57:42.517205-07');
